import React, { Component } from "react";
import { Link } from "react-router-dom";
import "./styles.scss";

class Footer extends Component {
  render() {
    return (
      <div className="container-fluid py-4 pb-3" id="footer-home">
        <div className="container">
          <div className="row">
            <div className="col-12 text-center">
              <img
                src="https://www.aorus.com/assets/img/logo_svg.2fc451ee.svg"
                alt=""
              />
            </div>
            <div className="col-12 my-3 size-18 text-white text-center">
              TEAM UP. FIGHT ON.
            </div>
            <div className="col-12">
              <Link to="/">
                <i className="size-18 fab fa-facebook-f" />
              </Link>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default Footer;
